import logo from "./logo.svg";

import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

import Footer from "./pages/admin/footer/Footer";
import Header from "./pages/admin/header/Header";
import Menu from "./pages/admin/menu/Menu";
import AdminProductType from './pages/admin/content/ProductTypeContent'
import AdminProductContent from "./pages/admin/content/ProductAddContent";
import { ProductTypeProvider } from './pages/context/ProductType/ProductTypeCtx'
function App() {
  return (
    <BrowserRouter>
      <Route path="/">
        <Header />
        <Menu />
      </Route>
      <Route path="/" exact>
        <AdminProductContent></AdminProductContent>
      </Route>
      <Route path="/productType" exact>
        <ProductTypeProvider>
          <AdminProductType></AdminProductType>
        </ProductTypeProvider>
      </Route>
    </BrowserRouter>
  );
}

export default App;
